searchIndex["libnotify"] = {"doc":"Rustic bindings to libnotify","items":[[3,"Notification","libnotify","`Notification` represents a passive pop-up notification. It can contain summary text, body text, and an icon, as well as hints specifying how the notification should be presented. The notification is rendered by a notification daemon, and may present the notification in any number of ways. As such, there is a clear separation of content and presentation, and this API enforces that.",null,null],[4,"Urgency","","The urgency level of the notification.",null,null],[13,"Low","","Low urgency. Used for unimportant notifications.",0,null],[13,"Normal","","Normal urgency. Used for most standard notifications.",0,null],[13,"Critical","","Critical urgency. Used for very important notifications.",0,null],[5,"is_initted","","Gets whether or not libnotify is initialized.",null,{"inputs":[],"output":{"name":"bool"}}],[5,"init","","Initialized libnotify. This must be called before any other functions.",null,{"inputs":[{"name":"str"}],"output":{"generics":["string"],"name":"result"}}],[5,"get_app_name","","Gets the application name registered.",null,{"inputs":[],"output":{"generics":["string"],"name":"option"}}],[5,"get_server_caps","","Synchronously queries the server for its capabilities and returns them as a Vector.",null,{"inputs":[],"output":{"generics":["string"],"name":"vec"}}],[5,"get_server_info","","Synchronously queries the server for its information, specifically, the name, vendor, server version, and the version of the notifications specification that it is compliant with.",null,{"inputs":[],"output":{"name":"option"}}],[5,"set_app_name","","Sets the application name. ## `app_name` The name of the application.",null,{"inputs":[{"name":"str"}],"output":null}],[5,"uninit","","Uninitialized libnotify.",null,{"inputs":[],"output":null}],[11,"clone","","",0,{"inputs":[{"name":"self"}],"output":{"name":"urgency"}}],[11,"fmt","","",0,{"inputs":[{"name":"self"},{"name":"formatter"}],"output":{"name":"result"}}],[11,"eq","","",0,{"inputs":[{"name":"self"},{"name":"urgency"}],"output":{"name":"bool"}}],[11,"ne","","",0,{"inputs":[{"name":"self"},{"name":"urgency"}],"output":{"name":"bool"}}],[11,"hash","","",0,null],[11,"clone","","",1,{"inputs":[{"name":"self"}],"output":{"name":"notification"}}],[11,"fmt","","",1,{"inputs":[{"name":"self"},{"name":"formatter"}],"output":{"name":"result"}}],[11,"hash","","",1,null],[11,"static_type","","",1,{"inputs":[],"output":{"name":"type"}}],[11,"eq","","",1,{"inputs":[{"name":"self"},{"name":"t"}],"output":{"name":"bool"}}],[11,"new","","Creates a new `Notification`. The summary text is required, but all other parameters are optional. ## `summary` The required summary text. ## `body` The optional body text. ## `icon` The optional icon theme icon name or filename.",1,{"inputs":[{"name":"str"},{"name":"p"},{"name":"q"}],"output":{"name":"notification"}}],[11,"close","","Synchronously tells the notification server to hide the notification on the screen.",1,{"inputs":[{"name":"self"}],"output":{"generics":["error"],"name":"result"}}],[11,"show","","Tells the notification server to display the notification on the screen.",1,{"inputs":[{"name":"self"}],"output":{"generics":["error"],"name":"result"}}],[11,"set_hint","","Sets a hint for `key` with value `value`. If `value` is `None`, a previously set hint for `key` is unset.",1,{"inputs":[{"name":"self"},{"name":"str"},{"generics":["variant"],"name":"option"}],"output":null}],[11,"set_image_from_pixbuf","","Sets the image in the notification from a `gdk_pixbuf::Pixbuf`. ## `pixbuf` The image.",1,{"inputs":[{"name":"self"},{"name":"pixbuf"}],"output":null}],[11,"clear_hints","","Clears all hints from the notification.",1,{"inputs":[{"name":"self"}],"output":null}],[11,"set_app_name","","Sets the application name for the notification. If this function is not called or if `app_name` is `None`, the application name will be set from the value used in `notify_init` or overridden with `notify_set_app_name`. ## `app_name` the localised application name",1,{"inputs":[{"name":"self"},{"name":"p"}],"output":null}],[11,"set_category","","Sets the category of this notification. This can be used by the notification server to filter or display the data in a certain way. ## `category` The category.",1,{"inputs":[{"name":"self"},{"name":"str"}],"output":null}],[11,"set_timeout","","Sets the timeout of the notification. To set the default time, pass `NOTIFY_EXPIRES_DEFAULT` as `timeout`. To set the notification to never expire, pass `NOTIFY_EXPIRES_NEVER`.",1,{"inputs":[{"name":"self"},{"name":"i32"}],"output":null}],[11,"set_urgency","","Sets the urgency level of this notification.",1,{"inputs":[{"name":"self"},{"name":"urgency"}],"output":null}],[11,"update","","Updates the notification text and icon. This won't send the update out and display it on the screen. For that, you will need to call `Notification::show`. ## `summary` The new required summary text. ## `body` The optional body text. ## `icon` The optional icon theme icon name or filename.",1,{"inputs":[{"name":"self"},{"name":"str"},{"name":"p"},{"name":"q"}],"output":{"generics":["string"],"name":"result"}}]],"paths":[[4,"Urgency"],[3,"Notification"]]};
